import React from "react";
import Card from "./Card";

const StudentDetailsScreen = () => {
  return (
    <div className="student-details-screen">
      <div className="card-container">
        <Card title="Payment Details">{/* Content for Payment Details */}</Card>
      </div>

      <div className="card-container">
        <Card title="School Details">{/* Content for School Details */}</Card>
      </div>

      <div className="card-container">
        <Card title="News">{/* Content for News */}</Card>
      </div>

      <div className="card-container">
        <Card title="School Calendar">{/* Content for School Calendar */}</Card>
      </div>

      <div className="card-container">
        <Card title="Exam Permit">{/* Content for Exam Permit */}</Card>
      </div>
    </div>
  );
};

export default StudentDetailsScreen;
